<script type="text/javascript">
$(document).ready(function(){
	
	var dialog_timeout_opened=false;
	var show_message=true;
	var pause=0;
	var timeout=7200; //7200
	var time_left=timeout;
	var myTimer;
	var limit=300;//300
	var type="close";
	var show_dialog=true;
	
	$('div[id=msg_dialog]').dialog({
		autoOpen: false,
		resizable: false,
		draggable: false,
		modal: true,
		width: 450,
		height:200,
		buttons: {
			"Turpināt sesiju": function() {			
				reset_timeout();
				type="reset";
				$(this).dialog("close"); 
			}
		}

	});
	
	
	$('div[id=msg_timeout]').dialog({
		autoOpen: false,
		resizable: false,
		draggable: false,
		modal: true,
		width: 450,
		height:200,
		buttons: {
			"OK": function() {
				$(this).dialog("close"); 
				location.reload();
			}
		}
	});
	
	$("#msg_dialog").bind('dialogclose',function(){
		dialog_timeout_opened=false;
		if(type=="close")
		{
			show_message=false;
			pause=30;
		}
		type="close";
	});
	
	function reset_timeout()
	{
		$.ajax({
			async: false,   
			type: "post",
			url: $("#wwwroot").text()+"/session.php",
			dataType: 'JSON',
			data:{"session":$("#session").text()},
			success: function(ansver)
			{ 
				var data = eval(ansver);
				time_left=timeout;
			}
		});
	}
	
	$("p[class=dialog_black]").css({"color":"black"});
	
	function timer()
	{
		if(time_left>0)
		{
			time_left=time_left-1;
					
			if(pause>0)
			{
				pause=pause-1;
				if(pause==0) show_message=true;
			}	
				
		
			var minutes=Math.floor(time_left/60);
			var seconds=parseInt(time_left%60);	
			if(seconds<10) seconds="0"+seconds;
			
			$("#time_left").text(minutes+":"+seconds);
			if(time_left<=limit && time_left>0 && show_message)
			{
				if(!dialog_timeout_opened)
				{
					dialog_timeout_opened=true;
					$("#msg_dialog").dialog("open");
				}	
			}
		}
		else if(time_left<=0)
		{
			if(dialog_timeout_opened)
			{
				$("#msg_dialog").dialog("close");
			}
			
			if(show_dialog)
			{
				$("#msg_timeout").dialog("open");
				show_dialog=false;
				logout_ortus();
			}	
			
		}
	}
	
	function start_timer()
	{
		if($("#isloggedin").text()=='1')
		{
			myTimer=window.setInterval(timer, 1000);
		}
	}

	function logout_ortus()
	{		var assign;
		 $.ajax ({
			 	crossDomain: true,
			 	headers: {"Access-Control-Allow-Origin": "*"},
			 	type: "GET",
			 	dataType: "text",			 	
		        url: "https://estudijas.rtu.lv/login/logout.php",
		        data: { sesskey : "" }, //optional		            
		        success: function( data ) {},
		        error: function (data){}
		    })
	}
	
	start_timer();

});
</script>


